import React from "react";
import cake from "./cake.png";
import brunch from "./brunch.png";
import kushcake from "./kushcake.png";

const Portfolio = () => {
  console.log(window.location.pathname);

  return (
    <div className="portfolio" style={{display:'flex'}}>
      <div className="graphic-art" style={{width:'33%'}}><img width='100%' src={brunch}/></div>
      <div className="graphic-art" style={{width:'33%'}}><img width='100%' src={cake}/></div>
      <div className="graphic-art" style={{width:'33%'}}><img width='100%' src={kushcake}/></div>

    </div>
  );
};

export default Portfolio;
